import React from 'react';
import Header from './components/Header';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
   return (
     <div className="App">
        <Header></Header>
        <div className="container">
          <div className="row event-nav">
            <div className="col-4 event-nav-com text-center border-right bo">
              Future events
            </div>
            <div className="col-4 event-nav-com text-center border-right">
              Invitations
            </div>
            <div className="col-4 event-nav-com text-center border-right">
              History
            </div>
          </div>
        </div>
     </div>
   );
 }

}


export default App;
